IMDB: http://www.imdb.com/title/tt1343073/combined
Genre: Drama
Runtime: 12 x 60 min.
Languages: Eesti / Estonian
Subtitles: English, Russian
DVDs: 3

Tuulepealne maa (lit. &quot;Windward Land&quot;) is a twelve-part Estonian television mini-series about the pre-World War II history of Estonia, its birth as a country, the Estonian War of Independence, post-war life throughout 1920 up to 1941 and World War II.

The series first aired on 9 October 2008 on Estonia's ETV. Each episode runs 60 minutes. The show was created by Mihkel Ulman and historian Lauri Vahtre, the series is produced by Raivo Suviste. DVD was published in 2009.

